import React from "react";
import TodoItem from "./TodoItem";
import "./TodoList.scss";
function TodoList() {
    return (
        <div className="list-item">
            <TodoItem
                status={false}
                name={"Test todo"}
                date={new Date().toLocaleDateString()}
            />
            <TodoItem
                status={true}
                name={"Test todo"}
                date={new Date().toLocaleDateString()}
            />
        </div>
    );
}
export default TodoList;
